    // Construct the UTM parameters
    const utmParams = [];



      // Add mandatory parameters
  	if(components.textinput2.value){
      var s=`utm_medium=`+components.textinput2.value;
      utmParams.push(s);
    }
  	if(components.textinput3.value)
    {
    	utmParams.push(`utm_source=`+components.textinput3.value);
    }

  	if(components.textinput4.value){
      utmParams.push(`utm_campaign=`+components.textinput4.value);
    }
    else
    {
